import { defineStore } from 'pinia'

export const useTeacherStore = defineStore('teacher', {
  state: () => ({
    teacherList: [
      {
        name: '李四',
        employeeId: '1',
        username: '王五',
        email: '1213770427@qq.com',
        phoneNumber: '13078901234',
        title: '教授',
        isJudge: 1,
        //学校
        school: '西南石油大学',
        //学院
        college: '计算机科学学院',
        // 证件类型
        idType: '身份证',
        // 证件号码
        idNumber: '123456789012345678',
        // 照片
        avatar:
          'data:image/jpeg;base64,'
      }
    ]
  }),

  actions: {
    addTeacher(teacher) {
      const index = this.teacherList.findIndex(
        (teacher) => teacher.employeeId === teacher.employeeId
      )
      if (index !== -1) {
        this.teacherList.push(teacher)
        this.localTeacherList()
        return true
      } else {
        console.error('已存在该学生')
        return false
      }
    },
    editTeacher(sutdent) {
      const index = this.teacherList.findIndex(
        (teacher) => teacher.employeeId === sutdent.employeeId
      )
      if (index !== -1) {
        Object.assign(this.teacherList[index], sutdent)
      }
      this.localTeacherList()
    },
    deleteTeacher(teacherId) {
      console.log(this.teacherList, teacherId, 'teacherId')
      const index = this.teacherList.findIndex(
        (teacher) => teacher.employeeId === teacherId
      )
      if (index !== -1) {
        this.teacherList.splice(index, 1)
      } else {
        console.error('未找到对应的老师')
      }
      this.localTeacherList()
    },
    localTeacherList() {
      localStorage.setItem('teacherList', JSON.stringify(this.teacherList))
    },
    getLocalTeacherList() {
      const teacherList = localStorage.getItem('teacherList')
      if (teacherList) {
        this.teacherList = JSON.parse(teacherList)
        return this.teacherList
      } else {
        return this.teacherList
      }
    }
  }
})
